//styles
import { Loading, FourOFour } from './Form.styles.js'


const Loader = () => {

    return (
        <>
        <Loading>
        <div class="loader"></div>
        </Loading>
        <FourOFour> <h2>404 cannot be found</h2> <div class="FourOFour">  </div> </FourOFour>

        </>
        )        
}

export default Loader
